import lottie from "lottie-web";
import animation from "./animations/work.json";

class Home extends Component {

  render() {
    return (
      <div className="app">
        {this.props.navbar}
        <Container fluid>
          <div>
            <Button color="secondary">
              <Link className="app-link" to="/Articles">Manage Articles</Link>
